import React from "react";
import MomCarCard from "./MomCarCard";

function MomsCarCollection( {momsCar}) {

    const displayMomCar = momsCar.map((momCar) => {
        return (
          <MomCarCard 
          momCar= {momCar} 
          key= {momCar.id}
           />
        )
      })

    return (
        <div>
            {displayMomCar}
        </div>
    )
}

export default MomsCarCollection;
